import React from "react";
import ExpenseItem from "./ExpenseItem";

function ExpenseList(props) {
  return (
    <ul className=".expenses-list">
      {props.items.map((exp) => {
        <ExpenseItem
          key={exp.id}
          title={exp.title}
          amount={exp.amount}
          date={exp.date}
        />;
      })}
    </ul>
  );
}

export default ExpenseList;
